import React from 'react';
import './App.css';
import { FaGithub, FaTwitter, FaReact } from "react-icons/fa";

function App() {
  return (
    <div className="App">
      <h1>Tennis Tweets<FaGithub /></h1> <FaGithub />
    </div>
  );
}

export default App;
